import React, { Component } from 'react';
function Hostel(props){
    return(
   
            <div className="col-lg-3 col-md-4 col-sm-6 col-12 mb-4 " >
        <div className="card text-center main_product_div">
          <img src={props.url} height="100px" alt="" className="img-fluid"/>
          <div className="card-body">
            <h5 className="card-title mb-0 text-uppercase">{props.name}</h5>
            <div className="details_div">
              <p className="text-muted small">{props.city}</p>
              <Link to={`/ShowProductStudent/${props.key}`} className="btn btn-secondary btn-profile py-1 secondary_button view_room_button">
                View Room
              </Link>
            </div>
          </div>
        </div>
      </div>

    )
}
export default Hostel;
